INSERT INTO `course` (`id`, `title`, `short_description`, `description`, `outcomes`, `language`, `category_id`, `sub_category_id`, `section`, `requirements`, `price`, `discount_flag`, `discounted_price`, `level`, `user_id`, `thumbnail`, `video_url`, `date_added`, `last_modified`, `course_type`, `is_top_course`, `is_admin`, `status`, `course_overview_provider`, `meta_keywords`, `meta_description`, `is_free_course`, `multi_instructor`, `creator`) VALUES
(1, 'Développeur Python | Formation Complète 2021', 'Apprenez la programmation en partant de zéro et créez des projets puissants avec Python : Web, Mobile, Jeux, Desktop', '<p xss=removed>Vous souhaitez devenir développeur et apprendre la programmation en partant de 0 ?</p><p xss=removed><br xss=removed></p><p xss=removed><strong xss=removed>Cette formation complète \"Développeur Python\" va vous permettre :</strong></p><p xss=removed>- D\'apprendre la programmation même si vous n\'avez aucunes connaissances</p><p xss=removed>- D\'obtenir des bases solides en programmation avec le langage Python</p><p xss=removed>- De connaitre la programmation orientée objet et de savoir créer vos propres programmes et algorithmes.</p><p xss=removed>- Et surtout de pouvoir créer tous types de projets : Applications bureau, Web, Mobile (iOS et Android), Jeux.</p>', '[\"Apprendre la programmation en partant de z\\u00e9ro\",\"Savoir exploiter toute la puissance de Python \\u00e0 travers diff\\u00e9rents projets\",\"Apprendre rapidement le d\\u00e9veloppement Web en partant de z\\u00e9ro : HTML \\/ CSS\",\"Utiliser le m\\u00eame code source pour d\\u00e9velopper sur toutes les plateformes : Windows, Mac, iOS, Android\"]', 'english', 4, 17, '[1]', '[]', 200, NULL, 0, 'beginner', '1', NULL, 'https://www.youtube.com/watch?v=am8z4xwCDgM&list=PL845AwtIxB2GS1Ldn1NlCHnuOl1W45MCX&index=7', 1634947200, 1637193600, 'general', 0, 1, 'pending', 'youtube', '', '', NULL, 0, 1),
(2, 'Apprendre à utiliser Excel pour les débutants', '', '', '[\"Construire une solide compr\\u00e9hension des bases de Microsoft Excel\",\"Apprendre \\u00e0 utiliser les fonctions Excel les plus utilis\\u00e9es\"]', 'francais', 4, 18, '[2]', '[\"Un ordinateur\",\"Microsoft Excel 2010 ou plus r\\u00e9cent\"]', 3000, NULL, 0, 'beginner', '1', NULL, 'https://www.youtube.com/watch?v=U4uZh-wdsOg', 1638316800, 1638748800, 'general', 0, 1, 'active', 'youtube', '', '', NULL, 0, 1),
(3, 'APPRENDRE LA PROGRAMMATION AVEC LE LANGUAGE  JAVA', 'Ce cours est chargée de présenter les bases du langage java et le faire comprendre grâce aux exemples pratiques simples et compréhensible à tout le monde.', '<p xss=removed>Ce cours est chargée de présenter les bases du langage java et le faire comprendre grâce aux exemples pratiques simples et compréhensible à tout le monde.</p><p xss=removed>Vous allez comprendre;</p><ul xss=removed><li xss=removed><p xss=removed>Installez et utilisez la machine virtuelle Java et l\'IDE Eclipse</p></li><li xss=removed><p xss=removed>les différents variables en java</p></li><li xss=removed><p xss=removed>les boucles et les conditions</p></li><li xss=removed><p xss=removed>les méthodes et le constructeur</p></li><li xss=removed><p xss=removed>l\'héritage et polymorphisme</p></li><li xss=removed><p xss=removed>les classes abstraites et les interfaces</p></li></ul>', '[\"Les bases de la programmation.\",\"Les bases de Java\",\"La programmation orient\\u00e9e objet\"]', 'francais', 4, 20, '[3,4,5]', '[\"Vous poss\\u00e9der un ordinateur et vous voulez vous lancer dans la programmation ce cours est fait pour vous\"]', 4500, NULL, 0, 'beginner', '1', NULL, 'https://www.youtube.com/watch?v=wZjE8GFkNPM', 1638835200, 1638835200, 'general', 1, 1, 'active', 'youtube', '', '', NULL, 0, 1),
(4, 'Révisez les  maths : Niveau Terminale C et D', 'Comprenez en profondeur les mathématiques Niveau Terminale C et D', '<p>Comprenez en profondeur les mathématiques Niveau Terminale C et D<br></p>', '[\"Comprendre les nombres complexes\",\"Comprendre les suite numerique\",\"D\\u00e9monstration par  r\\u00e9currence \",\"Limite de Fonction\",\"Probabilit\\u00e9s \",\"Exponentielle\",\"Logarithme\"]', 'francais', 16, 36, '[6,7,8,9,10]', '[\"Niveau terminale C ou D\"]', 1500, NULL, 0, 'beginner', '1', NULL, 'https://www.youtube.com/watch?v=2oIfFutAZyw&list=PLSOFOcyBRpIgS-RMW1IlsdomVJWwh13Ek', 1639872000, 1639872000, 'general', 1, 1, 'active', 'youtube', '', '', NULL, 0, 1),
(5, 'Formation Data-Scientist en R', 'Intéressés par la Data ? Apprenez à faire de la Data Science  avec le langage R sans pré-requis!', '<p>Intéressés par la Data ? Apprenez à faire de la Data Science  avec le langage R sans pré-requis!<br></p>', '[\"Utiliser Rstudio\",\"Programmer en R\",\"R\\u00e9cup\\u00e9rer des donn\\u00e9es et les charger dans R\",\"Connaitre les structures de donn\\u00e9es en R\",\"Manipuler efficacement des donn\\u00e9es avec dplyr\",\"Explorer et visualiser des donn\\u00e9es avec ggplot2\"]', 'francais', 4, 18, '[11,12,13]', '[]', 3000, NULL, 0, 'beginner', '1', NULL, 'https://www.youtube.com/watch?v=dIIWoM1fAp8&list=PLlIcksHGcYW2-IdKFYQ_nvmFNKF-tyo2W', 1639872000, 1639872000, 'general', 1, 1, 'active', 'youtube', '', '', NULL, 0, 1);
